import { useState } from "react";
import {Link,useNavigate} from 'react-router-dom';
import axios from 'axios';
Access-Control-Allow-Origin;
function Login() {
let [username,setUSername]=useState("");
let [password,setPassword]=useState("");

let navigate = useNavigate();
let signIn=async (event)=> {
    event.preventDefault();
    //let login = {"emailid":emailid,"password":password,"typeofuser":typeofuser};
    try{
    let result = await axios.post("http://localhost:8081/user/signin",username,password);
    //console.log(result.data);
    if(result.data=="Admin Success"){
        navigate("/Admin");
    }else if(result.data=="Customer success"){
        navigate("/Customer");
    }else {
        alert(result.data);
    }
    }catch(ex){
        console.log(ex);
    }
}
    return(
        <div>
        <div>Login Page</div>
        <form onSubmit={signIn}>
        <label>Username</label>
        <input type="username" name="username" onChange={e=>setUSername(e.target.value)}/><br/>
        <label>Password</label>
        <input type="password" name="password" onChange={e=>setPassword(e.target.value)}/><br/>
        <label>TypeOfUser</label>
        <input type="submit" value="submit"/>
        <input type="reset" value="reset"/><br/>
        <Link to="signup">SignUp</Link>
        </form>
        </div>
    )
}

export default Login;
